import React from 'react';
import './TrackList.css';
import Track from '../Track/Track.js'

export default class TrackList extends React.Component{
    constructor(props){
        super(props);
        this.RenderTrack = this.RenderTrack.bind(this);
    }

    RenderTrack(){
        let test = [1,2,3,4]
        //const tracks = test.map( (num) => <Track track={num} key={num}/>)
        const tracks = this.props.tracks.map( (track) => <Track track={track} key={track.id}/> );
        return tracks;
    }

    render(){
        return(
            <div className="TrackList">
                <this.RenderTrack />
            </div>
        );
    }
}
